{'query': 'PREFIX nmo: <http://nomisma.org/ontology#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT DISTINCT ?url ?thumbnailObverse ?thumbnailReverse ?descriptionObverse ?descriptionReverse
  ?date ?maxDiameter ?id ?weight ?type ?mint
WHERE {
  {
    ?url rdf:type nmo:NumismaticObject .
    ?url dcterms:identifier ?id .
    OPTIONAL {
      ?url nmo:hasObverse ?obverse .
      ?obverse nmo:hasIconography ?obverseIconography .
    }
    OPTIONAL {
      ?url nmo:hasMint ?mint .
    }
    ?url nmo:hasReverse ?reverseSide .
    ?reverseSide nmo:hasIconography ?reverseIconography .
    ?reverseIconography nmo:hasIconography ?reverseDesignIconography .
    ?reverseDesignIconography rdf:type rdf:Bag .
    ?reverseDesignIconography rdf:li ?reverseDescription .
    ?reverseDescription rdf:subject <https://www.wikidata.org/wiki/Q39503> .
    ?reverseDescription rdf:predicate <https://www.wikidata.org/wiki/Q108951109> .
    ?reverseDescription rdf:object <https://www.wikidata.org/wiki/Q46311> .
    OPTIONAL {
      ?url nmo:hasObverse ?obverseSide .
      ?obverseSide dcterms:relation ?obverseRelation .
      ?obverseRelation foaf:thumbnail ?thumbnailObverse .
    }
    OPTIONAL {
      ?url nmo:hasObverse ?obverseSide .
      ?obverseSide foaf:thumbnail ?thumbnailObverse .
    }
    OPTIONAL {
      ?url nmo:hasReverse ?reverseSide .
      ?reverseSide dcterms:relation ?reverseRelation .
      ?reverseRelation foaf:thumbnail ?thumbnailReverse .
    }
    OPTIONAL {
      ?url nmo:hasReverse ?reverseSide .
      ?reverseSide foaf:thumbnail ?thumbnailReverse .
    }
    OPTIONAL {
      ?url nmo:hasObverse ?obverseSide .
      ?obverseSide dcterms:description ?descriptionObverse .
      FILTER (lang(?descriptionObverse) = "en")
    }
    OPTIONAL {
      ?url nmo:hasReverse ?reverseSide .
      ?reverseSide dcterms:description ?descriptionReverse .
      FILTER (lang(?descriptionReverse) = "en")
    }
    OPTIONAL {
      ?url nmo:hasWeight ?weight .
    }
    OPTIONAL {
      ?url nmo:hasDate ?date .
      FILTER (lang(?date) = 'en')
    }
    OPTIONAL {
      ?url nmo:hasMaxDiameter ?maxDiameter .
    }
    OPTIONAL {
      ?url nmo:hasTypeSeriesItem ?type .
    }
  }
}'}

