PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?id ?link WHERE {

	?subject skos:exactMatch https://www.wikidata.org/wiki/Q39503 .
	?node rdf:subject ?subject .
	?predicate rdf:type https://www.wikidata.org/wiki/Q108951109 .
	?node rdf:predicate ?predicate .
	?object skos:exactMatch https://www.wikidata.org/wiki/Q46311 .
	?node rdf:object ?object .
	?bag rdf:li ?node .
	?design dcterms:hasPart ?bag ;
		dcterms:source ?coin .
	?coin dcterms:title ?id ;
		skos:exactMatch ?link .

}'}

